function Cityst(feature) {
	switch (feature.properties.Type) {
		case 'City': return {radius: 2.15, fillColor: "#000000", weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1};
		case 'Guardian City': return {radius: 2.35, fillColor: "#b550c1", weight: 1, fillOpacity: 1, color: "#000000", weight: .85, opacity: 1};
		case 'Major City': return {radius: 2.85, fillColor: "#e5de35", weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1};
		case 'Regional': return {radius: 1.65, fillColor: "#0a53a5", weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1};
		case 'Tiny_City': return {radius: 1.95, fillColor: "#ba0101", weight: 1, fillOpacity: 1, color: "#901717", weight: 1, opacity: 1};
		case 'Unnamed_City': return {radius: 2, fillColor: "#5a5757", weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1};
		
		default: return {radius: 1.25, fillColor: "#0099FF", weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1};
   };
}

function getCityc(c) {
    return c > 15  ? '#ba0101' :
           c > 7 ? '#c98925' :
           c > 4   ? '#000000' :
		   c > 0   ? '#775b7a' :
                      '#5a5757';
}

function citynum(feature) {
    return {
        fillColor: getCityc(feature.properties.City_Weigh),
        weight: 1, fillOpacity: 1, color: "#000000", weight: 1, opacity: 1
    };
}